import React from 'react';
import "./Footer.css";
import { FaLinkedin,FaInstagram,FaTwitter,FaGithub } from 'react-icons/fa';

const Footer = () => {
  return (
    <footer className='foot'>
      <div className="myfoot">
        <h1>Stay connected</h1>
        <p>New Delhi, India</p>
        <h3>+91-9582508117</h3>
      </div>
      <div className="foot-icons">
        <FaLinkedin/>
        <FaTwitter/>
        <FaGithub/>
        <FaInstagram/>
      </div>
    </footer>
  )
}

export default Footer
